import React from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownItem,
  DropdownToggle,
  DropdownMenu
} from 'reactstrap';
import resume from './images/resume.pdf';

/* The Navigation Bar component renders a DOM element that provides navigation shortcuts
 *  to the different parts of the page. When the browser isn't wide enough, this component
 *  also collapses into a mobile-friendly "hamburger menu" which toggles on and off.
 */

export class NavigationBar extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    //this.changeTheme = this.changeTheme.bind(this);
    this.closeNavbar = this.closeNavbar.bind(this);

    this.state = {
      isOpen: false,
      selected: [true, false, false],
    };
  }

  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }

  closeNavbar() {
    this.setState({
      isOpen: false
    });
  }

  render() {
    return (
        <Navbar id="top" className="navbar sticky-top" color="dark" dark expand="md">
          <NavbarBrand href="/">
            Scott Stubbs
          </NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="#Education" onClick={this.closeNavbar}>Academics</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#Jobs" onClick={this.closeNavbar}>Prior Experience</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#Projects" onClick={this.closeNavbar}>Projects</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#bottom" onClick={this.closeNavbar}>Hit me Up</NavLink>
              </NavItem>
              <NavItem>
                <NavLink target="_blank" href={resume}>Resume ;)</NavLink>
              </NavItem>

            </Nav>
          </Collapse>
        </Navbar>
    );
  }
}

export default NavigationBar
